防犯にもおすすめ。<br>センサーが人や車の動きを検知して自動点灯。<br><br>雨のかかる屋外にも設置できる防雨構造(IPX4相当)。<br>センサーが検知し、点灯を開始する周囲の明るさを調整可能。<br>好みに合わせて点灯時間を約5秒～10分の間で設定可能。<br><br>※おおよその設定ですので細かい設定はできません。<br><br>LEDなので省エネなのに明るい！<br>低赤外線・低UVで発熱が少なく虫も集まりにくい光です。<br><br>別売りのワイヤレスチャイム(EWS-10/EWS-20)と、無線で接続可能！<br>連動して、チャイムを鳴らすことができます。<br><br>検知エリアは目安です。<br>気温、服装、移動速度、侵入方向、体温、器具の設置状態などにより大きく変化します。<br><br>駐車場や玄関、お庭にどうぞ！<br><br>便利な3種の取付方法。<br>ネジ止め、クランプ、ステンレスバンド。<br><br>◆点灯保持時間/約5秒～約10分間<br>◆点灯開始照度/約5lx(夜)～(昼)<br>◆付属品/取付けネジ2本、コンクリート用スリーブ2本、マスキングカバー1個、クランプセット1台<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：朝日電器株式会社<br>検知方式：赤外線受動式<br>電源電圧：AC100V 50：60Hz<br>商品電力：約8.5W(待機時/約0.2W)<br>使用周囲温度範囲：-20℃～40℃<br>耐水性能：IP×4(防沫型)※直接雨のかかる屋外で使用可能<br>電源コード長：約3.0m<br>光源：白色 8WLED×1灯(全光束430ルーメン) ※LEDの交換はできません。<br>質量(電源コード含)：約520g<br><br>購入単位：1台<br>配送種別：在庫品</p></td></tr></table><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>お買い得 げきやす 最安値挑戦 さいやすねえちょうせん ELPA えるぱ エルパ 朝日電器株式会社 あさひでんきかぶしきがいしゃ 朝日電器 あさひでんき 4901087200535 LED センサーライト ESL-801AC センサー ライト用 ライト せんさー らいと 壁掛用 かべかけよう 壁掛け用 照明 インテリア 電化製品 電化 照明器具 しょうめいきぐ 防犯グッツ ぼうはんぐっつ 防犯グッズ ぼうはんぐっず 防災用品 ぼうさいようひん 防犯機器 ぼうはんきき 日用品 にちようひん 省エネ しょうえね 明るい あかるい 長寿命 ちょうじゅみょう P42360 p42360 9N1190 9n1190</font></td></tr></table><style type="text/css">
